import React from 'react';
import Field from './Filter/Field';
import ButtonSearch from './Filter/ButtonSearch';

const Menu = (props) => {
    const style = {
        marginTop: '12%'
    };
    return (
        <>
            <div className="col-md-3 produit">
                <div className="container" style={style}>
                    <div className="row">
                        <h3>{props.title}</h3>
                    </div>
                    <Field libelle={"Price min"} />
                    <Field libelle={"Price max"} />
                    <ButtonSearch />
                </div>
            </div>
        </>
    );
};

export default Menu;
